import './App.css';
import './bounce.css';
import React from 'react';
// import Typewriter from "typewriter-effect";
import { useWindup } from "windups";
const StringyWindup = () => {
  const [text] = useWindupString("Hello world!");
  return <div>{text}</div>;
};
function App() {
  return (
  <>
  <div id='intro'>
    <div id='name'>
      <div className="bouncing-text">
        <div className="b">h</div>
        <div className="o">i</div>
        <div className="u">,</div>
      </div>
      <div className="bouncing-text">
        <div className="b">i</div>
        <div className="o">'</div>
        <div className="u">m</div>
        <div className="n">N</div>
        <div className="c">a</div>
        <div className="e">v</div>
        <div className="f">i</div>
        <div className="g">d</div>
      </div>
    </div>
  </div>
  <div id='aboutMe'>
    
  </div>

  </>
  
  );
  
}




export default App;
//viewport height + 50% viewport height
